import React, { Component } from "react";

import "./Node.css";

export default class Node extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const { isStartNode, isEndNode } = this.props;
    const getNodeClass = isStartNode
      ? "start-node"
      : isEndNode
      ? "end-node"
      : "";

    return <div className="node"></div>;
  }
}
